function Sobre() {
    return (
        <>
            <h2>Sobre</h2>
            <p>Este projeto foi desenvolvido como parte da disciplina de <strong>Frontend</strong> no curso de <strong>Análise e Desenvolvimento de Sistemas da Pontifícia Universidade Católica do Rio Grande do Sul (PUC-RS)</strong>.</p>
            <p>O objetivo deste estudo é aplicar conceitos fundamentais de desenvolvimento web utilizando <strong>React</strong>, explorando a criação de componentes reutilizáveis, gerenciamento de estado e navegação dinâmica.</p>
            <p>Este trabalho foi realizado por <strong>Mateus Fardin</strong>, como parte do aprendizado e aprimoramento das habilidades na construção de interfaces interativas.</p>
        </>
    );
}

export default Sobre;
